import React, {useEffect, useState} from 'react';
import products from '../products'
import {Link} from 'react-router-dom'
import axios from 'axios';

function Home (props) {
    const [products, setProducts] = useState([]);

    useEffect(() => {
        const fetchData = axios.get
    })

    const productsList = products.products.map(product => {
        return (
            <div className="mb-5" style={{width: "33%"}}>
                <div className="card" style={{width: "18rem"}}>
                    <Link to={'/products/' + product._id}><img className="card-img-top" src="/images/pokeman.jpg"/></Link>
                    <div className="card-body">
                        <h5 className="card-title">
                            <Link to={'/products/' + product._id} style={{textDecoration: "none"}}>
                                {product.name}
                            </Link>
                        </h5>
                        <small className="card-text">{product.brand}</small>
                        <br/>
                        <strong className="card-text">${product.price}</strong>
                        <p>{product.numberOfReviews}</p>
                    </div>
                </div>
            </div>
        )
    })

    return (
        <div className="d-flex flex-wrap container mt-5" style={{flexWrap: "wrap"}}>
            {productsList}
        </div>
    )
}

export default Home;
